window.bookSummaryJSON = "<p><i>First of My Kind</i> is the story of Nathan Myers, a Missouri farm boy who, through a chain of events that happens halfway across the galaxy, finds his way from the seat of his Grandfather's tractor to the command of a starship from a lost super race.</p> <p>Nathan will tell you in his own words about the life and death struggles he encounters on his journey. He will tell you about the humor, peril, and pain of his galactic education. Even with the help of an eccentric A.I. and the most unlikely of allies, he still finds it easy to lose his humanity to the horrors and injustice of a galaxy no one could have imagined.</p>"; 
